(1, 'Apple chuyển sang dùng USB-C, có thể người dùng Android sẽ bớt đau đầu đi rất nhiều', '26-07-2019', 'Bước chuyển tất yếu\r\n\r\nCũng giống như tất cả những mùa hè trước, cơn bão tin đồn iPhone đã ùa về. Một trong những tin đồn đáng chú ý nhất nói về cổng kết nối của iPhone 2019, nơi Apple đã loại bỏ chuẩn Lightning quen thuộc để chuyển sang USB-C.\r\n\r\nThực chất, đây là một bước đi gần như không có gì bất ngờ. Chính Apple là tên tuổi lớn đầu tiên góp phần cho USB-C thu hút được sự chú ý của người tiêu dùng khi vén màn chiếc Macbook 12 inch vào năm 2014, trước khi Samsung và phần lớn các tên tuổi Android kịp đưa cổng kết nối này lên điện thoại của họ. Năm ngoái, Apple cũng đã đưa USB-C lên iPad Pro. Phó chủ tịch phụ trách kỹ thuật phần cứng của Apple là John Ternus đã từng khẳng định về USB-C: \"Một chiếc máy tính hiệu năng cao đòi hỏi một cổng kết nối hiệu năng cao\".\r\n\r\nVấn đề của Apple lúc này là Lightning đã quá lỗi thời, thua kém USB-C cả về tốc độ dữ liệu lẫn điện năng truyền tải. Chuyển sang USB-C sẽ giúp Apple giải quyết một trong những điểm thua kém rõ rệt nhất của iPhone so với các mẫu Android Trung Quốc là tốc độ sạc. Chuyển sang USB sẽ giúp mở ra một \"bầu trời\" phụ kiện mới. Quan trọng nhất, chuyển sang USB-C sẽ giúp loại bỏ điểm yếu cuối cùng trong trải nghiệm hiện tại của các iFan: phải mang nhiều loại cổng cắm khác nhau chỉ vì… Apple muốn vậy.', , 'Hoạt động');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(2, 'Chậm chân trong việc áp dụng camera góc rộng, nhưng iPhone 11 sẽ có một tính năng vượt trội so với Android', '26-07-2019', 'Một kiểu áp dụng công nghệ rất \'Apple\'!\r\n\r\nMặc dù chưa được ra mắt, nhưng iPhone 11 đã lộ rõ thiết kế cuối cùng, với điểm nhấn là hệ thống 3 camera siêu lớn ở mặt sau. 1 trong những camera đó được cho là sẽ có ống kính góc siêu rộng. Ống kính siêu rộng đã không còn là tính năng mới, khi những sản phẩm của LG như LG G5 và V20 đã có chúng từ tận 2016. Từ đó đến nay cũng đã có rất nhiều hãng khác áp dụng camera siêu rộng vào sản phẩm của mình. Loại camera này giúp người dùng chụp được một không gian rộng hơn, từ đó tạo ra góc nhìn ấn tượng, hoặc chụp được những vật lớn mà không cần phải lùi lại quá xa.\r\nVới kiểu áp dụng công nghệ rất \'Apple\', hãng công nghệ này không sử dụng luôn camera siêu rộng ngay như các hãng Android, mà đợi nó phát triển \'chín\' rồi mới dùng. Hơn nữa, iPhone 11 cũng được cho là sẽ có một tính năng đặc biệt mà những sản phẩm trước đây chưa có.\r\n\r\nTheo đó, mỗi khi người dùng chụp một ảnh thường, máy cũng sẽ tự động chụp một ảnh góc rộng. Nhờ có tính năng này, những lúc xem lại ảnh mà người dùng muốn ảnh \'mở rộng ra\' thì chỉ cần nhấn 1 nút là xong. Theo như 9to5mac thì tính năng sẽ được gọi là Smart Frame (Khung ảnh thông minh). Smart Frame cũng cho phép người dùng chỉnh lại góc nhìn để làm thẳng ảnh mà không cần phải thu nhỏ chúng lại vì máy sẽ tự động lấy thêm thông tin có sẵn từ những bức ảnh góc rộng. Phiên bản góc rộng của các bức ảnh sẽ được giữ trong một thời gian nhất định, nhưng sẽ tự động xóa vì những lý do về bảo mật.', , 'Hoạt động');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(3, 'Google ra mắt Gallery Go, ứng dụng quản lý ảnh cho smartphone giá rẻ', '26-07-2019', 'Ứng dụng này nhẹ, tốn ít dung lượng nhưng vẫn cung cấp một số tính năng thiết yếu cho người dùng.\r\nGoogle vừa mở rộng \"binh đoàn\" ứng dụng Android Go của họ bằng cách ro ra mắt một ứng dụng mới mang tên Gallery Go. Ứng dụng này thực chất là phiên bản rút gọn của Google Photos và được tối ưu dành cho các thiết bị Android Go.\r\n\r\nGallery Go có kích thước chỉ dưới 10MB nên người dùng thiết bị với dung lượng lưu trữ thấp sẽ không cần lo lắng việc ứng dụng này chiếm nhiều tài nguyên. Ngoài ra nó còn có ưu điểm khác nữa như khả năng hoạt động offline giúp tiết kiệm dữ liệu di động. Dù không nhiều tính năng như Google Photos nhưng Gallery Go có thể sắp xếp ảnh tự động. Theo Google, mỗi đêm ứng dụng này sẽ tự động xếp ảnh của bạn theo các danh mục khác nhau, tùy theo nội dung của ảnh.\r\n\r\nGallery Go cũng có thể tự cải thiện chất lượng ảnh cho bạn nhưng nếu không hài lòng, các công cụ chỉnh sửa ảnh đi kèm sẽ giúp bạn. Đương nhiên là các công cụ chỉnh sửa này không tiên tiến được như trên Google Photos nhưng bù lại chúng khá dễ dùng.\r\n\r\nGallery Go cũng hỗ trợ thư mục và thẻ SD. Vì thế, bạn có thể sắp xếp hình ảnh trong thư mục cũng như có thể di chuyển ảnh giữa bộ lưu trữ trên thiết bị và thẻ microSD. Hiện tại, Gallery Go có sẵn để tải về trên Google Play, nó hỗ trợ toàn bộ thiết bị Android chứ không chỉ riêng thiết bị Android Go.', , 'Hoạt động');
INSERT INTO `tin_tuc` (`Ma_tin_tuc`, `Ten_tin_tuc`, `Ngay_dang`, `Noi_dung`, `Image`, `Trang_thai`) VALUES
(4, 'Vivo V17 và V17 Neo chuẩn bị ra mắt, 2 camera trước dạng trượt, 4 camera sau', '26-07-2019', 'Bộ đôi thuộc dòng V17 của Vivo sẽ được trình làng trước tháng 10 năm nay.\r\n\r\nTheo thông tin mới nhất, Vivo đang gấp rút phát triển dòng V17 để ra mắt trước lễ hội Diwali, diễn ra vào tháng 10 tại Ấn Độ. Gần đây, hãng smartphone Trung Quốc đã ngừng kinh doanh V15 và V15 Pro tại Ấn Độ để sẵn sàng chào đón dòng V17 mới dự kiến bao gồm V17 và V17 Neo.\r\n\r\nThông tin rò rỉ cho thấy Vivo V17 có thể smartphone đầu tiên với 2 camera trước dạng trượt. Dự kiến, 2 camera trước của V17 sẽ nằm trên 1 cụm duy nhất, có thể trượt ra trượt vào chứ không chia thành 2 cụm như tai thỏ. Phía sau máy sẽ có 4 camera với camera chính dự kiến dùng cảm biến 48MP.\r\n\r\nThông tin về Vivo V17 hiện tại vẫn khá thưa thớt. Mặc dù vậy, nhìn vào V15 Pro chúng ta có thể đoán được một vài đặc điểm chính. Ví dụ, nhờ thiết kế camera trượt, Vivo V17 sẽ có màn hình chiếm gần trọn mặt trước cùng cảm biến vân tay dưới màn hình.\r\n\r\nTrong khi đó, V17 Neo dự kiến sẽ có thiết kế màn hình giọt nước. Các thông số dự kiến đi kèm với Vivo 17 Neo gồm chip MediaTek Helio P65, Android 9 Pie. Chưa có bất cứ thông tin nào về giá cũng như thời điểm lên kệ của bộ đôi Vivo V17.', , 'Hoạt động');

